INSERT INTO `event` (`event_id`, `event_name`, `event_client`, `event_address`, `event_desc`, `event_image`, `event_date_start`, `event_date_finished`) VALUES
(1, 'Dream World Wide in Jogja', 'Lumintu Logic', 'Gang, Jalan Candirejo, Jl. Pandega Siwi No.6A, Manggung, Caturtunggal, Depok Sub-District, Sleman Regency, Special Region of Yogyakarta 55281', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.', 'b3574d2f-2c93-4a75-b7ea-832ea6ed9860', '2021-10-03', '2021-10-05'),
(2, 'International Webinars and workshop on Javanese Culture', 'Keraton Ngayogyakarta', 'Jl. Pandega Siwi, Caturtunggal, Kec. Depok, Kabupaten Sleman, Daerah Istimewa Yogyakarta 55281, Indonesia', 'The Palace of Yogyakarta, as the center of Javanese Culture, has been continuously preserving various forms of Javanese cultural expression passed down from its ancestors. The palace ensures that the richness of Javanese culture reaches a wider audience across generations.\n\nSince 2019, The Palace of Yogyakarta has been hosting international symposiums on Javanese culture. The event is held alongside the anniversary of the accession to the throne (Tingalan Jumenengan Dalem) of Sri Sultan Hamengkubuwono X, which occurs every March 7. Amidst the pandemic situation, The Palace of Yogyakarta will hold International Webinar & Workshop on Javanese Culture. The event welcomes international academia to share their thoughts via four webinars. In addition to that, there will be online workshops that accommodate participants to learn handicraft and Javanese cuisines cooking technique. All events will be held for two hours every weekend in July 2021.\n\nInternational webinar and workshop on Javanese culture that will be held in July 2021 is expected to coincide with summer break in few regions. It is hoped that Javanese communities, not only in Indonesia, but also in countries like The Netherlands, Suriname, Malaysia, Singapore, New Caledonia and beyond will be able to participate in. Within these communities, we can see some similarities in their cultural expression, such as traditions or habits, language, performing arts, as well as philosophies. Scholarly dialogues, workshops, discussions, and any other academic based events are needed to keep the values and appreciation towards Javanese culture well maintained. These activities have become possible to actualize during this pandemic with the support of technology.', '4be71c9c-776c-4ff2-8fdf-d04389902ec4', '2021-10-10', '2021-10-11'),
(3, 'Borobudur International Symposium on Humanities and Social Science', 'Borobudur Symposium Comitee', 'Sekaran, Kec. Gn. Pati, Kota Semarang, Jawa Tengah 50229', 'Indonesia with its vast archipelago has been experiencing high growth in energy demand. The increase is commensurate with the rate of increase in economic development and in population growth, and with rapid developments in the industrial sector. To satisfy the energy demand, the Optimum Energy Mix approach has been taken, in which the selection of alternatives sources involve the considerations of energy diversification, safety, social, economic, public health, and environment. Through the approach, the target of 2030 will be reached i.e.; the compositions of energy mix will be 30.5% coal, 30.4% gas, 25.6% oil and 14% will be supplied by renewable and new energy sources including nuclear. Small Modular Reactors (SMRs) have been considered as a potential options to provide energy supply for small islands outside Java.\nBased on the World Health Organization (WHO), cancer is the second leading of fatal cause after cardiovascular disease. To help Indonesia in tackling the issue from nuclear sector, the Center of Science and Technology Accelerator of the National Nuclear Energy Agency (BATAN) is conducting R&D on particle acceleration and utilizing the Kartini Research Reactor (KRR) that is based on TRIGA Mark II Research Reactor located on the outskirts of the Yogyakarta Province. At the KRR, the facility for Boron Neutron Capture Therapy (BNCT) is going to be installed. The BNCT is a non-invasive therapeutic modality for treating locally invasive malignant tumors such as primary brain tumors and recurrent head and neck cancer with the non-radioactive isotope boron-10. The BNCT can be performed at a facility with a nuclear reactor or at hospitals that have developed alternative neutron sources, such as the KRR. Four of six beam ports at KRR will be equipped with a collimator, a device capable of narrowing the neutron beam. After decades of development, BNCT has reached clinical-trial stages in several countries, mainly for treating challenging cancers such as malignant brain tumors.\nIn agriculture sector, Indonesia is the worlds largest producer of palm oil as well as a leading global producer of other high value commodities such as cocoa, rubber and coffee. The country is rich in fertile land ideal for growing a diverse range of crops for both export and domestic consumption. BATAN in cooperation with the IAEA has been developing drought tolerant sorghum for food, animal feed and the bioethanol industry. Water scarcity is a problem in the drought prone areas of the hilly district of Gunung Kidul and in the sandy soil of the coastal Bantul district of Yogyakarta Province in Indonesia. Nuclear technology is being used to increase the genetic variability sorghum, by inducing mutations with gamma irradiation.\nThe industrial sector in Indonesia is the sector that currently contributes most to Indonesias annual GDP growth. The two most important sub-sectors of industry are mining and manufacturing, both being major pillars of the nation\'s economy since the 1970s, thus being engines of economic change and development. BATAN with RISTEKDIKTI and consortium member are conducting a preproject engineering to build a prototype small size medium light water reactor (SMR) to be in operation in 2024 - 2025. SMR has been acknowledged as a reliable and very safe nuclear technology to generate electricity and steam heat for industrial processes.\nIn environment sector, Indonesia has greatly under-reported on how much the primary rainforest has been illegally logged and the high level of pollutions generated by transportations, industries, and power plants. Nuclear power belongs to the set of energy sources and technologies available today that could help meet the climate-energy challenge. Greenhouse gases (GHGs), especially of carbon dioxide (CO2) from nuclear power plants are negligible. In this regards, in developed countries SMRs have also been considered as a potential option to replace the retiring coal power plants.\nThis International Symposium invites decision makers from relevant international organizations, experts on energy, economy and environment, business sectors, professors/academia, and researchers to present their scientific papers on the fields of: Energy, Health, Agriculture, Industry, and Environment.', '7c6e4eff-fd09-4212-834a-72f1c01e16bb', '2021-10-07', '2021-10-07');
